import React, { useEffect } from 'react'
import styled from 'styled-components'

const Black = styled.button`
  width: 40px;
  height: 130px;
  background: #93ac47;
  border: solid black 1px;
  box-shadow: 2px 5px;
  position: absolute;
  margin: 1px;
  margin-left: -20px;

  :active {
    background: #333;
  }
`

const White = styled.button`
  width: 60px;
  height: 200px;
  background: #495623;
  border: solid black 1px;
  box-shadow: 2px 5px;
  margin: 1px;
  margin-left: '-20px';
  box-sizing: border-box;

  :active {
    background: #eee;
  }
`

type Props = {
  color: string
  note: string
  key: string
  clickHandler: () => void
}

const Note: React.FC<Props> = ({ color, note, key, clickHandler }) => {
  return color == 'white' ? (
    <White value={note} onClick={clickHandler} />
  ) : (
    <Black value={note} onClick={clickHandler} />
  )
}

export default Note
